// code to deploy DyDx solo protocol locally
pragma solidity 0.6.12;
import {State} from './State.sol';
import {Ownable} from '@openzeppelin/contracts/access/Ownable.sol';

contract Admin is State, Ownable {
    function setSolarAddress(address _solar) public onlyOwner {
        g_state.solar = _solar;
    }

    function setTsunoAddress(address _tsuno) public onlyOwner {
        g_state.tsuno = _tsuno;
    }

    function setSatAddress(address _sat) public onlyOwner {
        g_state.sat = _sat;
    }
}
